import numpy as np
import pandas as pd
from sklearn.preprocessing import StandardScaler
from sklearn.neighbors import KNeighborsClassifier
from sklearn.metrics import accuracy_score
import matplotlib.pyplot as plt
import seaborn as sns
get_ipython().run_line_magic('matplotlib', 'inline')


# In[2]:


train_df = pd.read_csv('../input/Kannada-MNIST/train.csv')
test_df = pd.read_csv('../input/Kannada-MNIST/test.csv')
dig_df = pd.read_csv('../input/Kannada-MNIST/Dig-MNIST.csv')


# In[3]:


features = train_df.columns[1:]


# In[4]:


concat_df = pd.concat([train_df[features],test_df[features]]).reset_index(drop=False)


# In[5]:


ss = StandardScaler()
concat_df[features] = ss.fit_transform(concat_df[features])


# In[6]:


from sklearn.decomposition import TruncatedSVD
tsvd = TruncatedSVD(n_components=50).fit_transform(concat_df[features])


# In[7]:


tsvd = pd.DataFrame(tsvd,columns=['I'+str(i)for i in range(tsvd.shape[1])])


